[[package]]
name = "apipkg"
version = "2.1.0"
description = "apipkg: namespace control and lazy-import mechanism"
category = "main"
optional = false
python-versions = "!=3.0.*,!=3.1.*,!=3.2.*,!=3.3.*,>=2.7"

[[package]]
name = "atomicwrites"
version = "1.4.0"
description = "Atomic file writes."
category = "dev"
optional = false
python-versions = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*"

[[package]]
name = "attrs"
version = "21.2.0"
description = "Classes Without Boilerplate"
category = "main"
optional = false
python-versions = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"

[package.extras]
dev = ["coverage[toml] (>=5.0.2)", "hypothesis", "pympler", "pytest (>=4.3.0)", "six", "mypy", "pytest-mypy-plugins", "zope.interface", "furo", "sphinx", "sphinx-notfound-page", "pre-commit"]
docs = ["furo", "sphinx", "zope.interface", "sphinx-notfound-page"]
tests = ["coverage[toml] (>=5.0.2)", "hypothesis", "pympler", "pytest (>=4.3.0)", "six", "mypy", "pytest-mypy-plugins", "zope.interface"]
tests_no_zope = ["coverage[toml] (>=5.0.2)", "hypothesis", "pympler", "pytest (>=4.3.0)", "six", "mypy", "pytest-mypy-plugins"]

[[package]]
name = "aws-requests-auth"
version = "0.4.3"
description = "AWS signature version 4 signing process for the python requests module"
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
requests = ">=0.14.0"

[[package]]
name = "aws-xray-sdk"
version = "0.95"
description = "The AWS X-Ray SDK for Python (the SDK) enables Python developers to record and emit information from within their applications to the AWS X-Ray service."
category = "dev"
optional = false
python-versions = "*"

[package.dependencies]
jsonpickle = "*"
requests = "*"
wrapt = "*"

[[package]]
name = "awscli"
version = "1.22.51"
description = "Universal Command Line Environment for AWS."
category = "main"
optional = false
python-versions = ">= 3.6"

[package.dependencies]
botocore = "1.23.51"
colorama = ">=0.2.5,<0.4.4"
docutils = ">=0.10,<0.16"
PyYAML = ">=3.10,<5.5"
rsa = ">=3.1.2,<4.8"
s3transfer = ">=0.5.0,<0.6.0"

[[package]]
name = "backports.statistics"
version = "0.1.0"
description = "statistics backport 2.6 - 3.3"
category = "main"
optional = false
python-versions = "*"

[[package]]
name = "beautifulsoup4"
version = "4.10.0"
description = "Screen-scraping library"
category = "main"
optional = false
python-versions = ">3.0.0"

[package.dependencies]
soupsieve = ">1.2"

[package.extras]
html5lib = ["html5lib"]
lxml = ["lxml"]

[[package]]
name = "boto"
version = "2.49.0"
description = "Amazon Web Services Library"
category = "dev"
optional = false
python-versions = "*"

[[package]]
name = "boto3"
version = "1.20.51"
description = "The AWS SDK for Python"
category = "main"
optional = false
python-versions = ">= 3.6"

[package.dependencies]
botocore = ">=1.23.51,<1.24.0"
jmespath = ">=0.7.1,<1.0.0"
s3transfer = ">=0.5.0,<0.6.0"

[package.extras]
crt = ["botocore[crt] (>=1.21.0,<2.0a0)"]

[[package]]
name = "boto3-stubs"
version = "1.19.3"
description = "Type annotations for boto3 1.19.3, generated by mypy-boto3-builder 6.0.2"
